import HeroImg from "../images/manny.png";

const Hero = () => {
	return (
		<main className="flex gap-96 items-center w-full h-[82vh] px-28  text-gray-600 ">
			<div>
				<h1 className="text-4xl font-semibold">
					Orji
					<br />
					Emmanuel
				</h1>
				<span>Front-end Developer</span>
				<p>
					I'm an adept front-end developer with great experience in building
					amazing websites/application with modern technologies.
				</p>
			</div>
			<div>
				<img
					className="rounded-full"
					src={HeroImg}
					alt=""
					width={1050}
				/>
			</div>
		</main>
	);
};

export default Hero;
